import yfinance as yf
import pandas as pd
import numpy as np
import matplotlib.pyplot as plt
import seaborn as sns
from statsmodels.tsa.arima.model import ARIMA
# Import Prophet from prophet instead of fbprophet
from prophet import Prophet
import tensorflow as tf
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import LSTM, Dense, Dropout
from sklearn.preprocessing import MinMaxScaler
import xgboost as xgb

# Download Tesla stock data from Yahoo Finance
tesla = yf.download("TSLA", start="2015-01-01", end="2025-01-01")

# Display the first few rows
tesla.head()

# Check for missing values
print(tesla.isnull().sum())

tesla.duplicated().sum()

plt.figure(figsize=(12, 6))
plt.plot(tesla["Close"], label="Tesla Stock Price", color="blue")
plt.title("Tesla Stock Price (2015-2025)")
plt.xlabel("Year")
plt.ylabel("Stock Price (USD)")
plt.legend()
plt.show()

tesla["SMA_50"] = tesla["Close"].rolling(window=50).mean()  # 50-day Simple Moving Average
tesla["EMA_50"] = tesla["Close"].ewm(span=50, adjust=False).mean()  # 50-day Exponential Moving Average

plt.figure(figsize=(12, 6))
plt.plot(tesla["Close"], label="Close Price", color="blue", alpha=0.6)
plt.plot(tesla["SMA_50"], label="50-day SMA", color="red")
plt.plot(tesla["EMA_50"], label="50-day EMA", color="green")
plt.title("Tesla Stock Price with Moving Averages")
plt.legend()
plt.show()

"""# ðŸ“Œ Step 5: Time Series Forecasting Models

**ðŸ”¹ 1. ARIMA Model (Traditional Statistical Model)**
"""

# Train ARIMA model
arima_model = ARIMA(tesla["Close"], order=(5,1,0))  # (p,d,q)
arima_result = arima_model.fit()

# Forecast
tesla["ARIMA_Prediction"] = arima_result.predict()

# Plot
plt.figure(figsize=(12,6))
plt.plot(tesla["Close"], label="Actual Price", color="blue")
plt.plot(tesla["ARIMA_Prediction"], label="ARIMA Prediction", color="red")
plt.title("Tesla Stock Price Prediction using ARIMA")
plt.legend()
plt.show()

"""**ðŸ”¹ 2. Prophet Model (Facebook's Forecasting Tool)**"""

# Prepare Data for Prophet
df_prophet = tesla.reset_index()[["Date", "Close"]]
df_prophet.columns = ["ds", "y"]

# Train Prophet Model
model_prophet = Prophet()
model_prophet.fit(df_prophet)

# Create Future DataFrame
future = model_prophet.make_future_dataframe(periods=365)  # Forecast for 1 year

# Predict
forecast = model_prophet.predict(future)

# Plot Forecast
model_prophet.plot(forecast)
plt.title("Tesla Stock Price Forecast using Prophet")
plt.show()

"""#3.LSTM deep learning model"""

# Normalize Data
scaler = MinMaxScaler(feature_range=(0,1))
scaled_data = scaler.fit_transform(tesla["Close"].values.reshape(-1,1))

# Prepare Data for LSTM
train_size = int(len(scaled_data) * 0.8)
train_data, test_data = scaled_data[:train_size], scaled_data[train_size:]

def create_sequences(data, seq_length):
    sequences = []
    labels = []
    for i in range(len(data) - seq_length):
        sequences.append(data[i:i+seq_length])
        labels.append(data[i+seq_length])
    return np.array(sequences), np.array(labels)

seq_length = 60
X_train, y_train = create_sequences(train_data, seq_length)
X_test, y_test = create_sequences(test_data, seq_length)

# Build LSTM Model
model = Sequential([
    LSTM(units=50, return_sequences=True, input_shape=(seq_length, 1)),
    Dropout(0.2),
    LSTM(units=50, return_sequences=False),
    Dropout(0.2),
    Dense(units=25),
    Dense(units=1)
])

# Compile Model
model.compile(optimizer="adam", loss="mean_squared_error")

# Train Model
model.fit(X_train, y_train, epochs=20, batch_size=32)

# Predict
predictions = model.predict(X_test)
predictions = scaler.inverse_transform(predictions)

# Plot Results
plt.figure(figsize=(12,6))
plt.plot(tesla.index[train_size+seq_length:], tesla["Close"].values[train_size+seq_length:], label="Actual Price", color="blue")
plt.plot(tesla.index[train_size+seq_length:], predictions, label="LSTM Prediction", color="red")
plt.title("Tesla Stock Price Prediction using LSTM")
plt.legend()
plt.show()

"""#ðŸ”¹ 4. XGBoost Model


"""

# Prepare Data
features = ["Open", "High", "Low", "Volume"]
X = tesla[features]
y = tesla["Close"]

# Train-Test Split
train_size = int(len(X) * 0.8)
X_train, X_test, y_train, y_test = X[:train_size], X[train_size:], y[:train_size], y[train_size:]

# Train XGBoost Model
xgb_model = xgb.XGBRegressor(objective="reg:squarederror", n_estimators=100)
xgb_model.fit(X_train, y_train)

# Predict
xgb_predictions = xgb_model.predict(X_test)

# Plot Results
plt.figure(figsize=(12,6))
plt.plot(tesla.index[train_size:], y_test, label="Actual Price", color="blue")
plt.plot(tesla.index[train_size:], xgb_predictions, label="XGBoost Prediction", color="green")
plt.title("Tesla Stock Price Prediction using XGBoost")
plt.legend()
plt.show()

